import React from 'react'
import styled from 'styled-components'





const AllContry  = styled.div`
width  : 100%;
height : auto;
z-index : 200;
text-align : center;
background-color :none;
display : flex;
flex-direction : row;
flex-wrap : wrap


`


const Countrycontent = styled.div`
height : 60px;
width : 200px;
border : solid 1px black;
margin-top : 10px
`  



function Countrys() {





  return (
    <div>
      <AllContry>
      <Countrycontent></Countrycontent>





      </AllContry>
    </div>
  )
}


export default Countrys
